// src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CadastroForm from './components/CadastroForm';
import UserList from './components/UserList'; // Importando UserList

const App = () => {
    return (
        <Router>
            <div className="App">
                <Routes>
                    <Route path="/" element={<CadastroForm />} />
                    <Route path="/usuarios" element={<UserList />} /> {/* Rota para UserList */}
                </Routes>
            </div>
        </Router>
    );
};

export default App;
